 import React, { Component } from 'react'
 import './CharacterCreationForm.css'

 export default class CharacterCreationForm extends Component {

  submitAction() {
    alert("Submit Fired")
  }

  render () {
    return (
      <>
        <form onSubmit={this.submitAction}>
          <input name="character_name"  placeholder="Character Name" />
          <input name="player_name" placeholder="Player Name" />
          <input name="strength" type="text"  placeholder="Strength" />
          <input name="intelligence" type="text"  placeholder="Intelligence" />
          <input name="will" type="text"  placeholder="Will" />
          <input name="health" type="text"  placeholder="Health" />
          <input name="agility" type="text"  placeholder="Agility" />
          <button>Submit</button>

        </form>
      </>
    )
  }
 }
